//www.dorel.com","https://www.isoenergy.ca","https://www.uraniumroyalty.com","https://www.btgpactual.com.br","https://www.madergroup.com.au","https://www.himax.com.tw","https://www.petrusresources.com","https://www.verallia.com","https://www.pilbaraminerals.com.au","https://www.premierhealthgroup.ca","https://www.symbotic.com","https://www.on-running.com","https://www.acelon.com.tw","https://www.atoss.com","https://adapthealth.com","https://www.frenckengroup.com","https://www.bloomenergy.com","https://www.eqt.com","https://www.novocure.com","https://www.tialis.com"],"shape":[50],"dtype":"object","order":"little"}],["description",{"type":"ndarray","array":["PT Ladang Baja Murni Tbk distributes steel products and derivatives in Indonesia. The company trades in various steel products, including rule die steel, steel, copper, het lock, and cutting rule products, as well as spare parts. It also produces finish plates, mold base, and custom mold products. The company was founded in 1989 and is headquartered in Bekasi, Indonesia. PT Ladang Baja Murni Tbk is a subsidiary of PT Adyatama Global Investama.","Yunji Inc. operates a social e-commerce platform in the People's Republic of China. It offers a range of product categories that cater various daily needs of users and their households, including beauty and personal care, household goods, cloths, food and fresh produce, computer and electronics, apparel, bags and cases, baby and maternity products, and home appliances. Yunji Inc. was founded in 2015 and is headquartered in Hangzhou, the People's Republic of China.","PT Kurniamitra Duta Sentosa, Tbk operates as a food and beverage industry in Indonesia. It trades, distributes, and sells syrups, fruit mixes, frappe products, and gourmet sauces; coffee products; almond milk, soy milk, coconut milk, dairy milk, and free lactose milk products; and coffee makers. The company was founded in 2000 and is headquartered in Tangerang Selatan, Indonesia. PT Kurniamitra Duta Sentosa, Tbk is a subsidiary of PT Miki Ojisan Indomitra.","5paisa Capital Limited provides an online technology platform for trading in National Stock Exchange of India Limited, BSE Limited, and MCX. The company offers financial services, including online discounted stock broking, depository services; distributes mutual funds, bonds, and debentures, as well as insurance products; and provides equity and mutual fund research, investment advisory services, etc. It provides peer-to-peer lending services through its platform 5paisa and mobile app 5Paisa Loans. In addition, the company offers its services through a web-based trading terminal, mobile application, and a state of the art call and trade unit. It serves retail investors and high-volume traders. 5paisa Capital Limited was incorporated in 2007 and is headquartered in Thane, India.","CSP Steel Center Public Company Limited manufactures and distributes steel products in Thailand. It offers steel sheets, such as master coil, cutting sheet, slitting coil, and tolling for processing steel. The company also provides hot-rolled and cold-rolled steel sheets and pipes; and specializes in customizing steel sheets to other shapes. It serves clients in the automobiles, home and electric appliances, steel furniture, general usage, and structure and construction industries. The company was formerly known as CSP Trading Company Limited and changed its name to CSP Steel Center Public Company Limited in July 2005. CSP Steel Center Public Company Limited was founded in 1992 and is headquartered in Bangkok, Thailand.","M-tron Industries, Inc. designs, manufactures, and markets frequency and spectrum control products. It operates in two product groups, Frequency Control and Spectrum Control. The Frequency Control product group includes a portfolio of quartz crystal resonators, clock oscillators, VCXO, TCXO OCXO, and DOCXO devices. These products are designed for applications in aerospace and defense, telecommunications infrastructure, and instrumentation markets. The Spectrum Control product group comprises an array of radio frequency (RF), microwave and millimeter wave filters, and diplexers covering a frequency range from 1 MHz to 90 GHz, and solid-state power amplifiers covering a frequency range from 300 MHz to 26 GHz, with power output from 10 Watts to 10 kWatts. The filter devices include crystal, ceramic, LC, tubular, combline, cavity, interdigital and metal insert waveguide, as well as digital, analog, and mechanical tunable filters, switched filter arrays, and RF subsystems. The power amplifiers add active devices comprise GaN, GaAS FET, LDMOS, and chip and wire technologies in narrow or broadband, module, or rack-mounted packages. These products are used in applications in the commercial and military aerospace, defense, space, and other commercial markets. The company was founded in 1965 and is based in Orlando, Florida.","TXO Energy Partners, L.P. engages in the acquisition, development, optimization, and exploitation of conventional oil, natural gas, and natural gas liquid reserves in North America. As of July 31, 2022, it had working interest in the 850,009 gross acres located in the United States primarily in the San Juan Basin of New Mexico and Colorado, and the Permian Basin of West Texas and New Mexico. The company was founded in 2012 and is based in Fort Worth, Texas.","Iguatemi S.A., together with its subsidiaries, operates shopping centers in Brazil. It designs, plans, develops, and manages shopping malls, outlets, and mixed-use real estate complexes, as well as office towers. The company operates a network of 14 shopping centers, 2 outlet stores, and 3 office towers with a total gross leased area of approximately 711,000 square meters. In addition, it provides economic, financial, tax advisory, and consulting services. The company was formerly known as Jereissati Participa\u00e7\u00f5es S.A. and changed its name to Iguatemi S.A. in November 2021. The company was founded in 1946 and is headquartered in S\u00e3o Paulo, Brazil.","Tharisa plc, an investment holding company, engages in the mining, processing, beneficiation, marketing, sale, and logistics of platinum group metals (PGM) and chrome concentrates in China, South Africa, Singapore, Hong Kong, the United Arab Emirates, Australia, Japan, and internationally. The company operates through four segments: PGM, Chrome, Agency and Trading, and Manufacturing. The company's PGM basket includes platinum, palladium, ruthenium, rhodium, iridium, nickel, copper, and gold. It operates the Tharisa mine located on the south-western limb of the Bushveld Complex, South Africa. The company also offers chemical and foundry grade chrome concentrates; and metallurgical grade chrome concentrate for stainless steel and ferrochrome producers, as well as commodity traders. In addition, it is involved the manufacturing of mining equipment. Tharisa plc was incorporated in 2008 and is based in Paphos, Cyprus.","Victorian Plumbing Group plc operates as an online retailer of bathroom products and accessories. It offers a range of products to B2C and trade customers with approximately 125 brands, as well as designs and develops in-house products. The company's bathroom product lines include tiles, flooring, and lighting. Victorian Plumbing Group plc was incorporated in 2021 and is based in Skelmersdale, United Kingdom.","Digital Workforce Services Oyj. provides robotic process automation services (RPA) and intelligent automation (IA) solutions worldwide. The company offers automation delivery services, which include IA talent augmentation that is a way to allocate role-based intelligent automation experts in IA analysis, IA development, IA testing, IA quality assurance, and data science; and automation implementation services consisting of management of the process of planning, defining, designing, developing, and deploying intelligent automation. It also offers advisory services comprising value discovery workshops, such as IA impact workshop, IA strategy alignment, IA potential assessment, and IA-enabled process transformation that help executive management to understand the business value of intelligent automation; capability development services, including trusted advisor, capability development, and IA infrastructure consulting that help IA centers of excellence and automation teams to build capability that could deliver the business value of intelligent automation; and training courses for citizen and RPA analysts and developers, RPA program managers, etc. In addition, the company provides managed services consisting of Robot as a Service platform that integrates robotic process automation with Microsoft cognitive services and advanced Azure functionalities, such as data lake, functions, and analytics services; Roboshore, an RPA managed service; Run Management, an RPA maintenance service; automation programs comprising Robotic Operating Model Acceleration, an acceleration program for intelligent automation solution; and IA Cloud Migration, a program that supports organizations to transition an existing IA portfolio to a platform residing in the cloud. It serves banking, health and social care, insurance, manufacturing and logistics, services, and public sectors. The company was incorporated in 2015 and is based in Helsinki, Finland.","PT Sumber Global Energy Tbk, together with its subsidiaries, engages in coal trading and shipment services in Indonesia. The company engages in the wholesale of solid, liquid, gas, and renewable energy; and mining of rare earth metals and minerals. It also engages in the hotel, agency, and contracting businesses, as well as provision of other supporting mining activities. In addition, it offers transportation and warehousing services. It serves companies operating in the energy sector. The company was founded in 2008 and is headquartered in South Jakarta, Indonesia. PT Sumber Global Energy Tbk is a subsidiary of PT Sumbermas Inti Energi.","SAAM Development Public Company Limited develops and sells renewable energy power plants in Thailand. The company operates through two segments, Development Service and Distribution of Electricity. It develops and manages inhouse solar energy power plants; procures project land and provides related services; and invests in renewable energy power plants and non-energy businesses. The company was formerly known as SAAM Energy Development Public Company Limited and changed its name to SAAM Development Public Company Limited in September 17, 2021. SAAM Development Public Company Limited was founded in 2007 and is based in Bangkok, Thailand.","Oceanus Group Limited, an investment holding company, sells processed marine products, alcoholic beverages, cosmetics, and coffee in Singapore and the People's Republic of China. It operates through Live Marine Products, Trading, and Consultancy segments. The company also cultivates and sells abalone and other products; provides consultancy services related to fish farming; and acquires technologies for aquaculture and fishery business. In addition, it is involved in the operation of fish hatcheries and fish farms, as well as provision of fishery research services; trading animal feeds and canned abalone; wholesale of various goods; production of aquaculture and abalone farming, and sale of products; media, marketing, and consultancy; and advertising and motion picture/video production businesses. The company markets its products under the Oceanus brand. Oceanus Group Limited was incorporated in 1998 and is based in Singapore.","Advik Capital Ltd. is a non-banking financial company, which engages in the provision of financial loans and ancillary services. It operates through the Loans and Trade in Securities segments. The company was founded on November 14, 1985 and is headquartered in New Delhi, India.","Tocvan is a well-structured exploration development company. Tocvan was created in order to take advantage of the prolonged downturn the junior mining exploration sector, by identifying and negotiating interest in opportunities where management feels they can build upon previous success. Tocvan has approximately 32 million shares outstanding and is earning 100% into two exciting opportunities in Sonora, Mexico: the Pilar Gold-Silver project and the El Picacho Gold-Silver project. Management feels both projects represent tremendous opportunity to create shareholder value.","Marathon Digital Holdings, Inc. operates as a digital asset technology company that mines cryptocurrencies with a focus on the blockchain ecosystem and the generation of digital assets in United States. As of December 31, 2021, it had approximately 8,115 bitcoins, which included the 4,794 bitcoins held in the investment fund. The company was formerly known as Marathon Patent Group, Inc. and changed its name to Marathon Digital Holdings, Inc. in February 2021. Marathon Digital Holdings, Inc. was incorporated in 2010 and is headquartered in Las Vegas, Nevada.","Pilot Energy Limited engages in the acquisition, exploration, and development of conventional oil and gas assets in Australia. It holds 100% working interests in EP416 and EP480 exploration permits located in southern Perth basin; a 21.25% working interest in WA-481 exploration permit; and a 13.058% working interest in the EP437 situated in the northern Perth basin. The company also holds a 60% working interest in the WA-481-P exploration permit located in Perth basin. In addition, it focuses on blue hydrogen and renewables projects. The company was formerly known as Rampart Energy Ltd and changed its name to Pilot Energy Limited in May 2013. Pilot Energy Limited was incorporated in 1998 and is based in Bondi Junction, Australia.","Future Health ESG Corp. does not have significant operations. The company focuses on effecting a merger, capital stock exchange, asset acquisition, stock purchase, reorganization, or similar business combination with one or more businesses. It intends to pursue an initial business combination opportunity in the smart health technology sector. The company was incorporated in 2021 and is based in Dover, Delaware.","Gravity Co., Ltd. develops and publishes online and mobile games in South Korea, Taiwan, Thailand, and Japan. The company offers a massively multiplayer online role-playing game, including Ragnarok Online, Dragonica, Ragnarok Online II, and Ragnarok Prequel II. Its mobile games portfolio includes Ragnarok M: Eternal Love; Ragnarok Origin; Ragnarok X: Next Generation; the Labyrinth of Ragnarok; Ragnarok Poring Merge; Tera Classic; Ragnarok: The Lost Memories; Sadako M; NBA: Rise To Stardom; Milkmaid Of The Milky Way; and Paladog Tactics. The company also provides console games, such as Ragnarok DS for Nintendo DS; Ragnarok: The Princess of Light and Darkness for PlayStation Portable; Ragnarok Odyssey for PlayStation Vita; Double Dragon II for Xbox 360; Ragnarok Odyssey Ace for PlayStation Vita and PlayStation 3; and GRANDIA HD Collection for Nintendo Switch. In addition, it offers games for IPTV, including Pororo: The Little Penguin; and markets dolls, stationery, food, and other character-based merchandises, as well as game manuals, monthly magazines, and other publications. Further, the company provides system development and maintenance services, as well as system integration services to third parties. As of December 31, 2021, it owned 156 registered domain names. The company was incorporated in 2000 and is headquartered in Seoul, South Korea. Gravity Co., Ltd. is a subsidiary of GungHo Online Entertainment, Inc.","Kidoz Inc. develops and sells AdTech software products in Western Europe; Central, Eastern, and Southern Europe; North America; and internationally. The company also owns and develops mobile Kidoz safe ad network, the Kidoz kid-mode operating system, the Kidoz publisher SDK, the Rooplay edugames platform, and the Rooplay originals. In addition, it offers Rooplay, the cloud-based EduGame system for kids to learn and play. The company was formerly known as Shoal Games Ltd. and changed its name to Kidoz Inc. in April 2019. Kidoz Inc. was incorporated in 1987 and is based in The Valley, Anguilla.","Norwegian Energy Company ASA, an oil and gas company, focuses on the exploration, development, and production of hydrocarbon resources in Norway, Denmark, the Netherlands, and the United Kingdom. Its asset portfolio includes four production hubs and 11 producing fields on the Danish Continental Shelf. As of December 31, 2021, the company had proven and probable reserves of 9.8 million barrels of oil equivalent. Norwegian Energy Company ASA was founded in 2005 and is headquartered in Oslo, Norway.","MRS Log\u00edstica S.A. is a logistics operator that manages a rail network in Brazil. It transports containers; cement; bauxite; agricultural; coke; coal; iron ore; and steel products, such as iron ore, coal, and coke. The company was founded in 1996 and is based in Rio de Janeiro, Brazil.","BYD Company Limited, together with its subsidiaries, engages in the research, development, manufacture, and sale of automobiles and related products in the People's Republic of China and internationally. The company operates through three segments: The Secondary Rechargeable Batteries and Photovoltaic; Mobile Phone Components, Assembly, and Other Products; and Automobiles, Automobile-Related Products and Other Products. The Secondary Rechargeable Batteries and Photovoltaic segment manufactures and sells lithium-ion and nickel batteries, photovoltaic products, and iron batteries primarily for mobile phones, power tools, photovoltaic and energy storage products, and electric vehicles. The Mobile Phone Components, Assembly, and Other Products segment manufactures and sells casings and other mobile phone and electronic product components; provides complete machine assembly services; and offers epidemic prevention materials. The Automobiles, Automobile-Related Products and Other Products segment is involved in the manufacture and sale of automobiles comprising hybrid, battery-electric buses, taxis, sanitation, and passenger vehicles; automobile-related molds and parts; automobile leasing and after-sales services of automobiles; and rail transit and related businesses. In addition, it offers rail transit equipment; solar batteries and arrays; and urban rail transportation services. The company was founded in 1995 and is headquartered in Shenzhen, China.","Thor Explorations Ltd., a natural resources company, engages in the acquisition, exploration, development, and production of mineral properties in Senegal, Burkina Faso, Nigeria, and Canada. The company primarily explores for gold and silver deposits. Its flagship property is the Segilola gold project located in Osun State, Nigeria. The company was incorporated in 1968 and is based in Vancouver, Canada.","CONSOL Energy Inc. produces and exports bituminous coal in the United States. It operates through PAMC, CONSOL Marine Terminal, and Other segments. The company engages in the mining, preparation, and marketing of bituminous coal to power generators, industrial end-users, and metallurgical end-users; and provision of coal export terminal services, as well as development of the Itmann Mine and the Greenfield reserves. It owns and operates the Pennsylvania Mining Complex (PAMC), which includes the Bailey Mine, the Enlow Fork Mine, the Harvey Mine, and the Central Preparation Plant; and CONSOL Marine Terminal located in the port of Baltimore. As of December 31, 2021, the company had 612.1 million tons of proven and probable coal reserves at PAMC. It also owns approximately 1.4 billion tons of Greenfield reserves located in the Northern Appalachian, Central Appalachian, and Illinois basins. The company was founded in 1860 and is headquartered in Canonsburg, Pennsylvania.","Adani Energy Solutions Limited, together with its subsidiaries, generates, transmits, and distributes power in India. The company operates through Transmission, Trading, and GTD Business segments. It establishes, commissions, operates, and maintains electric power transmission systems. The company is involved in the dealing of bullion and agro commodities; and laying of optical ground wire fibers on transmission lines to provide telecom solutions to telecom companies, internet service providers, and long-distance communication operators. The company was formerly known as Adani Transmission Limited and changed its name to Adani Energy Solutions Limited in July 2023. The company was founded in 2006 and is headquartered in Ahmedabad, India. Adani Energy Solutions Limited is a subsidiary of S.B. Adani Family Trust.","Hi-Tech Pipes Limited manufactures and sells steel products for infrastructure, constructions, automobiles, energy, agriculture, defense, engineering, and telecom industries in India. It offers ERW black steel pipes and tubes used in fencing, line pipes, scaffolding, water and gas conveyance, oil country tubular, hand pumps, collieries, thermal powers, telecom, automobiles, and agriculture sector; rectangular and hollow sections; galvanized and pre-galvanized steel pipes and tubes; metal beam crash barriers for applications, such as national highways, expressways, bridges and flyovers, embankments, mines, collieries, high density fast moving traffic areas in cities, motor racing/test drove tracks, village areas along highways, crash test sites, factory areas, traffic safety in airports, plants handling hazardous chemicals, and multi-story parking lots. The company also provides cold rolled sheets and strips used in precision tubes, containers, bicycles, furniture, color coating, galvanizing and tinning, and automobile industry to produce car body panels; and cold formed sections, as well as solar mounting structures and various other galvanized products. It operates through a network of approximately 200 distributors and 300 dealers. Hi-Tech Pipes Limited also exports its products. The company was formerly known as Ram Lal Harbans Lal Limited and changed its name to Hi-Tech Pipes Limited in October 1986. Hi-Tech Pipes Limited was incorporated in 1985 and is headquartered in New Delhi, India.","Knaus Tabbert AG, together with its subsidiaries, manufactures and sells leisure vehicles in Europe. It operates through Premium and Luxury segments. The company offers motorhomes, caravans, and camper vans under the KNAUS, TABBERT, WEINSBERG, T@B, and MORELO brands. It also operates RENT AND TRAVEL, an internet platform for renting leisure vehicles through a network of dealers operating approximately 180 rental stations. The company was founded in 1912 and is headquartered in Jandelsbrunn, Germany.","SilverBow Resources, Inc., an oil and gas company, acquires and develops assets in the Eagle Ford shale and Austin Chalk located in South Texas. As of December 31, 2021, it had proved reserves of 1,416 billion cubic feet of natural gas equivalent. The company was formerly known as Swift Energy Company and changed its name to SilverBow Resources, Inc. in May 2017. SilverBow Resources, Inc. was founded in 1979 and is headquartered in Houston, Texas.","Dorel Industries Inc. designs, manufactures, sources, markets, and distributes home products and juvenile products worldwide. The company's Dorel Home segment engages in the design, manufacture, sourcing, and distribution of ready-to assemble furniture and home furnishings products, folding chair and tables, outdoor and juvenile furniture, futons, bunk beds, mattresses, bedroom, dining, home entertainment, and office furniture, upholstery, step stools and ladders, and hand trucks. This segment markets its products under the Ameriwood, Altra, System Build, Ridgewood, DHP, Dorel Fine Furniture, Dorel Living, Signature Sleep, Cosmo Living, Novagratz, Little Seeds, Queer Eye, Cosco, and Alphason brands. Its Dorel Juvenile segment manufactures and distributes infant car seats, strollers, travel systems high chairs, play yards, safety aids, swings/toys, early learning/infant health, mobiles, baby toys, playpens, and developmental toys under the Maxi-Cosi, Quinny, Tiny Love, Safety 1st, BebeConfort, Cosco, Mother's Choice, Disney, and Infanti brands. The company sells its products to mass merchant discount chains, department stores, club format outlets, and hardware/home centers; Internet retailers; independent boutiques and juvenile specialty stores; and sporting goods stores. It also owns and operates approximately 88 retail stores in Chile and Peru, as well as various factory outlet retail locations in Europe. The company was formerly known as Dorel Co. Ltd. and changed its name to Dorel Industries Inc. in May 1987. Dorel Industries Inc. was incorporated in 1962 and is headquartered in Westmount, Canada.","IsoEnergy Ltd. engages in the acquisition, development, evaluation, and exploration of uranium mineral properties. It primarily holds interest in the Larocque East, Geiger, Thorburn Lake, Radio, Hawk, Ranger, and Collins Bay Extension properties in the Athabasca Basin of Saskatchewan, Canada, as well as interests in various other properties. The company was incorporated in 2016 and is headquartered in Saskatoon, Canada. IsoEnergy Ltd. is a subsidiary of NexGen Energy Ltd.","Uranium Royalty Corp. operates as a pure-play uranium royalty company. It acquires, accumulates, and manages a portfolio of geographically diversified uranium interests. The company has royalty interests in the McArthur River, Cigar Lake / Waterbury Lake, Roughrider, Russell Lake, Russell Lake south, and Dawn Lake projects in Saskatchewan, Canada; Anderson and Workman Creek projects in Arizona; Lance and Reno Creek projects in Wyoming; Church Rock and Roca Honda projects in New Mexico; Dewey-Burdock project in South Dakota; Slick Rock project in Colorado; Langer Heinrich project in Namibia; and Michelin project in Newfoundland and Labrador, Canada. The company was incorporated in 2017 and is headquartered in Vancouver, Canada.","Banco BTG Pactual S.A. provides financial products and services in Brazil and internationally. Its investment banking services include advisory services relating to mergers and acquisitions, divestitures, restructurings, spin-offs, reorganizations, and other corporate transactions; placement and advisory services in primary and/ or secondary public offerings; structuring and distribution of fixed income instruments; and financial advisory, issuance coordination, and specific financing structures for energy and infrastructure projects. The company's wealth management products and services comprise trading in bonds, equities, options, futures, structured products, and cash instruments; investment funds; alternative investments, such as hedge funds, private equity, real estate, and structured credit funds; debit and credit cards; portfolio solutions; and clearing and custody services. It also offers credits to large and medium-sized companies, as well as offers a platform for the management and acquisition of non-performing corporate loans, and distressed real estate portfolios; credit operations and anticipation of receivables for small and medium-sized companies; and deals with companies under liquidation or bankruptcy. The company also provides products and services in the local and international markets which include market making, brokerage and settlement, transactions with derivatives, interest rates, exchange, equities, energy, insurance, and reinsurance. In addition, it offers asset management services through investment funds and managed portfolios, as well as invests on behalf of institutional investors, including pension funds, corporations, insurance companies, financial intermediaries, governments, and high-net-worth individuals and family offices. The company was founded in 1983 and is based in Sao Paulo, Brazil. Banco BTG Pactual S.A. is a subsidiary of BTG Pactual Holding Financeira Ltda.","Mader Group Limited, a contracting company, provides specialized technical services in the mining, energy, and industrial sectors in Australia and internationally. It offers rail services, digger and drill support team, fabrication and line boring, non-processing and processing infrastructure, power generation and marine, field support, professional support roles, maintenance projects, electrical services, component exchange, rapid response teams, rostered support, HME shutdown teams, specialized tool hire, clean team, trade upgrade program, training national workforces, and maintenance centre services. The company also provides in-field technical support, major overhauls and repairs, preventative equipment maintenance, training of maintenance teams, and ancillary services. Mader Group Limited was founded in 2005 and is headquartered in Perth, Australia.","Himax Technologies, Inc., a fabless semiconductor company, provides display imaging processing technologies in China, Taiwan, the Philippines, Korea, Japan, Europe, and the United States. The company operates through two segments, Driver IC and Non-Driver Products. It offers display driver integrated circuits (ICs) and timing controllers that are used in televisions, laptops, monitors, mobile phones, tablets, automotive, digital cameras, car navigation, virtual reality devices, and other consumer electronic devices. The company also designs and provides controllers for touch sensor displays; in-cell touch and display driver integration single-chip solutions; light-emitting diode driver and power management ICs; and liquid crystal on silicon microdisplays for augmented reality (AR) devices and head-up displays for the automotive industry. In addition, it offers complementary metal-oxide-semiconductor image sensors and wafer-level optics for AR devices, 3D sensing, and ultra-low power AI image sensing, which are used in various applications, such as mobile phones, tablets, laptops, TV, PC camera, automobile, security, medical devices, home appliance, Internet of Things, etc. The company markets its display drivers and display-related products to panel manufacturers, agents or distributors, module manufacturers, and assembly houses; and non-driver products to camera module manufacturers, optical engine manufacturers, and television system manufacturers. Himax Technologies, Inc. was incorporated in 2001 and is headquartered in Tainan City, Taiwan.","Petrus Resources Ltd., an energy company, engages in the acquisition, exploration, development, and exploitation of oil and gas development assets in western Canada. The company focuses on risk-managed exploration. It primarily explores for natural gas, natural gas liquids, and crude oil and condensate. In addition, the company primarily holds an average 51% working interest in the Ferrier/Strachan area comprise 43,159 net acres, which include 29,219 net acres of undeveloped and 13,940 net acres of developed land located in west central Alberta near the town of Rocky Mountain House, Alberta. Further, it holds an average of 64% working interest in the Thorsby/Pembina area consisting of 69,042 net acres of land covering 22,135 net acres of undeveloped land and 46,907 net acres of developed land located in the southwest of Edmonton, Alberta; and an average of 50% working interest in the Foothills area that consists of 30,748 net acres of undeveloped land and 6,687 net acres of developed land located northwest of Rocky Mountain House, Alberta. Petrus Resources Ltd. was incorporated in 2015 and is headquartered in Calgary, Canada.","Verallia Soci\u00e9t\u00e9 Anonyme produces and sells glass packaging products for beverages and food industry worldwide. It provides bottles and jars for still and sparkling wines, spirits, food products, beers, soft drinks, and mineral water. The company was founded in 1827 and is headquartered in Courbevoie, France.","Pilbara Minerals Limited explores for, develops, and operates mineral resources in Australia. The company primarily holds a 100% interest in the Pilgangoora lithium-tantalum project located in the Pilbara region of Western Australia. The company was incorporated in 2005 and is based in West Perth, Australia.","Premier Health of America Inc., a specialized healthcare services company, provides staffing and outsourced service solutions for healthcare needs in Canada. It also offers health consulting, nursing, and health-care services in remote communities, as well as medical transport services; and Code Bleu, an agency to employ nurses, caregivers, dental staff, and other health-related personnel. The company provides its services through PSweb, a CRM platform. It serves governments, corporations, individuals, public and private hospitals, medical clinics, and retirement homes. The company was founded in 2003 and is headquartered in Blainville, Canada.","Symbotic Inc., an automation technology company, provides robotics and technology to improve efficiency for retailers and wholesalers in the United States. It offers The Symbotic System, a full-service warehouse automation system that reduces costs, improves efficiency, and maximizes inventory. The company is based in Wilmington, Massachusetts.","On Holding AG develops and distributes sports products worldwide. It offers athletic footwear, apparel, and accessories. The company offers its products through independent retailers and distributors, online, and stores. On Holding AG was founded in 2010 and is headquartered in Zurich, Switzerland.","Acelon Chemicals &amp; Fiber Corporation manufactures and sells textile products worldwide. It offers filament yarns, including nylon, nylon/polyester conjugate, m\u00e9lange, and polyester yarns; functional yarns, such as cooling, antistatic, moisture wicking, antibacterial, thermal, and abrasion resistant nylon yarns; and ECO friendly yarns, including bio based nylon, dope dyed, abrasion resistant nylon, recycled dope dyed color, and recycled polyester and nylon yarns. The company provides its products under AcePaleta, AceIce, AceStatic, AceCool, AceHygeia, AceVitality, DuraXtend, AceEcobio, AceColor, AceColor ECO, and AceECO brands. Its products are used in various end markets, such as ready-made garments, outdoor functional products, household goods, industrial products, etc. The company was founded in 1988 and is based in Changhua, Taiwan.","ATOSS Software AG, together with its subsidiaries, develops and sells workforce management software in Germany, Austria, Switzerland, and internationally. The company's solutions include Crewmeister; ATOSS Time Control, a software solution for time and attendance management, and workforce scheduling for small to medium-sized customers, as well as large decentralized organizations; and ATOSS Staff Efficiency Suite is multi-client for large-scale companies and international corporations for comprehensive time and attendance management, resource planning, and demand planning. In addition, the company offers software implementation and training services; and sells software licenses. It serves customers in the manufacturing and production, healthcare and social services, retail and chain stores, hospitality, logistics and transportation, and service industries. ATOSS Software AG was founded in 1987 and is headquartered in Munich, Germany.","AdaptHealth Corp., together with its subsidiaries, provides home medical equipment (HME), medical supplies, and home and related services in the United States. The company provides sleep therapy equipment, supplies, and related services, such as CPAP and bi-PAP services to individuals suffering from obstructive sleep apnea; medical devices and supplies, including continuous glucose monitors and insulin pumps to patients for the treatment of diabetes; HME to patients discharged from acute care and other facilities; oxygen and related chronic therapy services in the home; and other HME devices and supplies on behalf of chronically ill patients with wound care, urological, incontinence, ostomy, and nutritional supply needs. It serves beneficiaries of Medicare, Medicaid, and commercial insurance payors. AdaptHealth Corp. is headquartered in Plymouth Meeting, Pennsylvania.","Frencken Group Limited, an investment holding company, provides original design, original equipment, and diversified integrated manufacturing solutions worldwide. It operates in two segments, Mechatronics and Integrated Manufacturing Services (IMS). The Mechatronics segment designs, develops, and produces precision-engineered systems and machines, electromechanical assemblies, and high precision parts and components for original equipment manufacturers in the healthcare, analytical and life sciences, semiconductor, and industrial automation markets. It also offers value engineering, prototyping, program machining components and sheet metal parts manufacturing, and modular and equipment system assembly, integration, testing, and commissioning; assembly, testing, designs, engineers, and manufactures mechatronic modules, products, and systems; and research, development, and engineering services. The IMS segment provides integrated contract design and manufacturing services to the automotive, and consumer and industrial electronics industries. This segment design, engineers, manufactures, and sells filters; manufactures mold and die, plastic products, and component sub-assembly; injection mold making and injection molding; manufactures and distributes plastic products; and designs and trades in micro-mechanical product components for automotive industry. The company also engages in the property holding activities; and provision of vacuum coating, thermal treatment, and other related services for plastic component. Frencken Group Limited was founded in 1995 and is based in George Town, Malaysia.","Bloom Energy Corporation designs, manufactures, sells, and installs solid-oxide fuel cell systems for on-site power generation in the United States and internationally. The company offers Bloom Energy Server, a power generation platform that converts fuel, such as natural gas, biogas, hydrogen, or a blend of these fuels, into electricity through an electrochemical process without combustion. It serves data centers, hospitals, healthcare manufacturing facilities, biotechnology facilities, grocery stores, hardware stores, banks, telecom facilities and other critical infrastructure applications. The company was formerly known as Ion America Corp. and changed its name to Bloom Energy Corporation in September 2006. Bloom Energy Corporation was incorporated in 2001 and is headquartered in San Jose, California.","EQT Corporation operates as a natural gas production company in the United States. The company produces natural gas, natural gas liquids (NGLs), including ethane, propane, isobutane, butane, and natural gasoline. As of December 31, 2021, it had 25.0 trillion cubic feet of proved natural gas, NGLs, and crude oil reserves across approximately 2.0 million gross acres, including 1.7 million gross acres in the Marcellus play. The company was founded in 1878 and is headquartered in Pittsburgh, Pennsylvania.","NovoCure Limited, an oncology company, engages in the development, manufacture, and commercialization of tumor treating fields (TTFields) devices for the treatment of solid tumor cancers in the United States, Europe, the Middle East, Africa, Japan, and Greater China. Its TTFields devices include Optune for the treatment of glioblastoma; and Optune Lua for the treatment of malignant pleural mesothelioma. The company also has ongoing or completed clinical trials investigating TTFields in brain metastases, gastric cancer, glioblastoma, liver cancer, non-small cell lung cancer, pancreatic cancer, and ovarian cancer. NovoCure Limited was incorporated in 2000 and is headquartered in Saint Helier, Jersey.","Tialis Essential IT PLC, through its subsidiaries, provides network, cloud, and IT managed services to public and private companies in the United Kingdom. Its cloud and hosting services include co-location, private, public, and hybrid cloud, DR and business continuity, and cloud migration; network and connectivity service includes cloud connectivity, multi-protocol label switching, local and wide area network, and distributed denial of service protection services; collaboration services comprise hosted telephony and unified communication; managed services include remote infrastructure management, tech bars and on-site resources, field and smart hands, threat protection, and professional services; and device management services comprise procurement, configuration and integration, deployment, management, and retirement services. The company was formerly known as IDE Group Holdings plc and changed its name to Tialis Essential IT PLC in November 2022. Tialis Essential IT PLC was founded in 2005 and is based in Edinburgh, the United Kingdom."],"shape":[50],"dtype":"object","order":"little"}],["ceo",{"type":"ndarray","array":["Mr. Jimmy  Irawan","Mr. Shanglue  Xiao","Mr. Hengky  Wijaya","Mr. Narayan  Gangadhar","Mr. Supachai  Chaisupat","Mr. Michael J. Ferrantino Jr.","Mr. Bob R. Simpson","Ms. Cristina Anne Betts","Mr. Phoevos  Pouroulis","Mr. Mark Andrew Radcliffe","Mr. Jussi Samuli Vasama","Mr. Welly  Thomas","Mr. Podduang  Kongkamee","Mr. Heng Kang  Koh PBM",null,"Mr. Brodie A. Sutherland BSc (Geol), MAuslMM, MSEG, P.Geo.","Mr. Frederick G. Thiel","Mr. Bradley William Lingo B.A., BA (hons), J.D., M.A.I.C.D., MAICD","Ms. Jesvin  Kaur","Mr. Hyun Chul  Park","Mr. Jason M. Williams","Mr. Euan  Shirlaw","Mr. Guilherme Segalla De Mello","Mr. Chuan-Fu  Wang","Mr. Olusegun  Lawson BSc, MBA","Mr. James A. Brock","Mr. Kandarp  Patel","Mr. Ajay Kumar Bansal","Mr. Wolfgang N. Speck","Mr. Sean C. Woolverton","Mr. Martin  Schwartz","Mr. Phillip  Williams (Commerce), B.Com., B.Comm. CFA, C.F.A., CFA","Mr. Scott Eric Melbye","Mr. Roberto  Balls Sallouti","Mr. Justin  Nuich M.B.A.","Mr. Jordan  Wu","Mr. Ken  Gray P.Eng.","Mr. Patrice
